import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Welcome(props) {
  return <h1>Hello, {props}</h1>;
}

const element = Welcome("Sara");

ReactDOM.render(
  element,
  document.getElementById('root')
);
